import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center'
    },
    logo: {
        width: 214,
        height: 120,
        marginTop: 74,
        marginBottom: 48
    }
});
